import TextField from '@material-ui/core/TextField';

export const SignUp = () => {
	return (
		<div>
			<form className={classes.root} noValidate autoComplete='off'>
				<TextField
					error
					id='filled-error-helper-text'
					label='Error'
					defaultValue='Hello World'
					helperText='Incorrect entry.'
					variant='filled'
				/>
			</form>
			SignUp
		</div>
	);
};
